// this component for about page
import React, { Component } from 'react';
function About (){
        return(
            <section className="hero-section">
                <h1> How To Use E-Court</h1><br></br>
                <p> 1. Go to Add our Case and fill the form. and you will get <br></br>
                    the CNR No. Note that no.<br></br>
                    2. If you have the CNR no. you can search by cnr no.<br></br>
                    3. if you are not able to understart what is case type <br></br>
                    go to case type section and check.<br></br>

                </p>
            </section>
        );

    }
export default About;
